from os import stat, system
from rich.console import Console

console = Console()


class PurplePandaPrints():
    @staticmethod
    def print_title(text):
        console.print(text, style="yellow bold", highlight=False)

    @staticmethod
    def print_title2(text):
        console.print(text, style="yellow", highlight=False)

    @staticmethod
    def print_dict(the_dict):
        for k, v in the_dict.items():
            k = k.replace("_", " ").replace("-", " ").capitalize()
            PurplePandaPrints.print_key_val(k, v)

    @staticmethod
    def print_key_val(k, v):
        console.print(f"{k}: [purple]{v}[/purple]", style="green bold", highlight=False)

    @staticmethod
    def print_val(v):
        console.print(v, style="purple bold", highlight=False)

    @staticmethod
    def print_separator():
        console.print("==================================================================================",
                      style="yellow bold")
        print("")

    @staticmethod
    def print_logo():
        system(f'printf "{logo}"')


